@Suppress("LongParameterList")
internal fun makeCellFromPath(
    numberPathList: List<String>,
    numberColor: Color,
    backgroundColor: Color,
    shadowColor: Color,
    centerLineColor: Color? = null,
    crownPathList: List<String>? = null,
    crownColor: Color? = null,
    crownDarkColor: Color? = null,
    viewportWidth: Float = 204f,
    viewportHeight: Float = 216f,
    oddForPathStartingFrom: Int = Int.MAX_VALUE,
): ImageVector {
    val strokeBrushShadow = SolidColor(shadowColor)
    val strokeBrushBackground = SolidColor(backgroundColor)
    val strokeBrushNumber = SolidColor(numberColor)

    return ImageVector.Builder(
        defaultWidth = viewportWidth.dp,
        defaultHeight = viewportHeight.dp,
        viewportWidth = viewportWidth,
        viewportHeight = viewportHeight,
    ).run {
        addPath(
            pathData = addPathNodes(SHADOW),
            name = "shadow",
            fill = strokeBrushShadow,
        )
        addPath(
            pathData = addPathNodes(BACKGROUND),
            name = "background",
            fill = strokeBrushBackground,
        )
        centerLineColor?.let {
            val strokeBrushCenterLine = SolidColor(it)
            addPath(
                pathData = addPathNodes(CENTER_LINE),
                name = "center_line",
                fill = strokeBrushCenterLine,
            )
        }
        if (numberPathList.isNotEmpty()) {
            numberPathList.forEachIndexed { index, numberPath ->
                addPath(
                    pathData = addPathNodes(numberPath),
                    pathFillType = if (index >= oddForPathStartingFrom) PathFillType.EvenOdd else PathFillType.NonZero,
                    name = "number",
                    fill = strokeBrushNumber,
                )
            }
        }
        crownPathList?.let {
            addPath(
                pathData = addPathNodes(it[0]),
                fill = SolidColor(crownColor!!),
            )
            addPath(
                pathData = addPathNodes(it[1]),
                fill = SolidColor(crownDarkColor!!),
            )
        }
        build()
    }
}
